import React from 'react';
import ReactDom from 'react-dom'
import './App.css'
import Header from './Header';
import MainContent from './MainContent';
function Footer() {
  return (
    <small>&copy;2023 Powell-Louis development. All rights reserved</small>
)
}

function Page() {
  return (
    <>
      <Header />
      <MainContent />
      <Footer />
    </>
  )
}

ReactDom.render(
  <Page />,
  document.getElementById('root')
);
